import { Container, Row, Col, Tab, Nav } from "react-bootstrap";
import { ProjectCard } from "./ProjectCard";
import java_poo from "../assets/img/java_poo.png";
import react_iniciantes from "../assets/img/react_iniciantes.png";
import micros from "../assets/img/micros.png";
import seguranca_informacao from "../assets/img/seguranca_informacao.png";
import semana_academica from "../assets/img/sem_academica.png";
import clutch from "../assets/img/4clutch_api.png";
import qrmail from "../assets/img/qrmail.png";
import radiator from "../assets/img/radiator.png";
import arabic_roman from "../assets/img/arabic_roman.png";
import beverage from "../assets/img/beverage.png";
import portfolio from "../assets/img/portfolio.png";
import colorSharp2 from "../assets/img/color-sharp2.png";
import 'animate.css';
import TrackVisibility from 'react-on-screen';

export const Projects = () => {

  const projects = [
    {
      title: "4Clutch-API",
      description: "Trabalho Acadêmico | API para site de skins de CS2",
      imgUrl: clutch,
    },
    {
      title: "QR-Mail",
      description: "Design & Development",
      imgUrl: qrmail,
    },
    {
      title: "Radiator Store",
      description: "Design & Development",
      imgUrl: radiator,
    },
    {
      title: "Arabic to Roman Converter",
      description: "Design & Development",
      imgUrl: arabic_roman,
    },
    {
      title: "Beverage Distributor",
      description: "Design & Development",
      imgUrl: beverage,
    },
    {
      title: "Este portfólio",
      description: "Design & Development",
      imgUrl: portfolio,
    },
  ];

  const certifications = [
    {
      title: "java",
      description: "udemy",
      imgUrl: java_poo,
    },
    {
      title: "React",
      description: "udemy",
      imgUrl: react_iniciantes,
    },
    {
      title: "Microservices",
      description: "udemy",
      imgUrl: micros,
    },
    {
      title: "Seg",
      description: "Seguranca_informacao",
      imgUrl: java_poo,
    },
    {
      title: "Semana academica",
      description: "udemy",
      imgUrl: semana_academica,
    }
  ]

  return (
    <section className="project" id="projects">
      <Container>
        <Row>
          <Col size={12}>
            <TrackVisibility>
              {({ isVisible }) =>
              <div className={isVisible ? "animate__animated animate__fadeIn": ""}>
                <h2>Experiência</h2>
                <p>Abaixo estão alguns dos trabalhos que já realizei, como também cursos e aprendizados</p>
                <Tab.Container id="projects-tabs" defaultActiveKey="first">
                  <Nav variant="pills" className="nav-pills mb-5 justify-content-center align-items-center" id="pills-tab">
                    <Nav.Item>
                      <Nav.Link eventKey="first">Projetos</Nav.Link>
                    </Nav.Item>
                    <Nav.Item>
                      <Nav.Link eventKey="second">Certificações</Nav.Link>
                    </Nav.Item>
                    <Nav.Item>
                      <Nav.Link eventKey="third">Ver mais</Nav.Link>
                    </Nav.Item>
                  </Nav>
                  <Tab.Content id="slideInUp" className={isVisible ? "animate__animated animate__slideInUp" : ""}>
                    <Tab.Pane eventKey="first">
                      <Row>
                        {
                          projects.map((project, index) => {
                            return (
                              <ProjectCard
                                key={index}
                                {...project}
                                />
                            )
                          })
                        }
                      </Row>
                      <a>testeeeeeeee</a>
                    </Tab.Pane>
                    <Tab.Pane eventKey="second">
                      <p>AALorem ipsum dolor sit amet consectetur adipisicing elit. Cumque quam, quod neque provident velit, rem explicabo excepturi id illo molestiae blanditiis, eligendi dicta officiis asperiores delectus quasi inventore debitis quo.</p>
                      <Row>
                        {
                          certifications.map((project, index) => {
                            return (
                              <ProjectCard
                                key={index}
                                {...project}
                                />
                            )
                          })
                        }
                      </Row>
                    </Tab.Pane>
                    <Tab.Pane eventKey="third">
                      <p>AALorem ipsum dolor sit amet consectetur adipisicing elit. Cumque quam, quod neque provident velit, rem explicabo excepturi id illo molestiae blanditiis, eligendi dicta officiis asperiores delectus quasi inventore debitis quo.</p>
                    </Tab.Pane>
                  </Tab.Content>
                </Tab.Container>
              </div>}
            </TrackVisibility>
          </Col>
        </Row>
      </Container>
      <img className="background-image-right" src={colorSharp2}></img>
    </section>
  )
}
